import React, { useEffect, useState } from "react";
import "./userpage.css"

const UserPage = () => {
    const [users, setUsers] = useState([]);

    const callApi = async () => {
        const data = await fetch("http://localhost:3000/users");
        const result = await data.json();
        setUsers(result);
    };


    useEffect(() => {
        callApi();
    }, [])


    return (
        <div>
            userPage
            <table>
                <thead>
                    <tr>
                        <th>ID</th>
                        <th>Email</th>
                        <th>Username</th>
                        <th>Full Name</th>
                        <th>Department</th>
                        <th>Position</th>
                        <th>Actions</th>
                    </tr>
                </thead>
                <tbody>
                    {users?.map((user) => (
                        <tr key={user.id}>
                            <td>{user.id}</td>
                            <td>{user.email}</td>
                            <td>{user.userName}</td>
                            <td>{user.fullName}</td>
                            <td>{user.department}</td>
                            <td>{user.position}</td>
                            <td>
                                <button>Edit</button>
                                <button>Delete</button>
                            </td>
                        </tr>
                    ))}
                </tbody>
            </table>
        </div>
    );

}
export default UserPage;
